import React from 'react';
import { withRouter } from 'react-router-dom';
import clsx from 'clsx';
import { withStyles } from '@material-ui/styles';
import { Typography, Fab, Avatar } from '@material-ui/core';
import ExportIcon from '@material-ui/icons/ArrowUpward';
import styles from './styles';

const ToolBarClassDetail = props => {
    const { classes, className } = props;

    return (
        <div className={clsx(classes.root, className)}>
            <Typography variant="overline">presence detail</Typography>
            <div className={classes.title}>
                <Typography variant="h3">He thong thong tin</Typography>
            </div>
            <div className={classes.title}>
                <Typography variant="subtitle1">
                    Here’s what’s happening with your projects today
                </Typography>
            </div>
            <div className={classes.row}>
                <Typography variant="body2">by</Typography>
                <Avatar src="//www.gravatar.com/avatar/f8aef9003205946523250a062b54bbb6?s=200&r=pg&d=mm" />
                <Typography variant='h6'>
                    Tran Lap
                </Typography>
            </div>
            <div className={classes.row}>
                <span className={classes.spacer} />
                <Fab
                    variant="extended"
                    size="medium"
                    color="primary"
                    aria-label="export"
                    className={classes.margin}
                >
                    <ExportIcon className={classes.exportIcon} />
                    Export
                </Fab>
            </div>
        </div>
    );
};
export default withRouter(withStyles(styles)(ToolBarClassDetail));
